import React from 'react';
import './App.css';

import { Album } from './Album';

import SearchForm from './components/SearchForm/SearchForm';

const App = () => {
  // const album: Album = { name: 'albumName' };
  const albuns: Album[] = [
    {
      name: 'Album Name',
      source_image: './assets',
      genre: 'Rock',
      artist: 'Linkin Park',
      year: 2017,
      songs: [{ title: 'Song1' }, { title: 'Song2' }],
    },
  ];
  console.log(albuns.type());
  return (
    <div className='App'>
      <h2>Vmusic</h2>
      <SearchForm />
    </div>
  );
};

export default App;
